{"source":{"uri":"features\/AboutGMOSite.feature","data":"Feature:  \nAs an online shopper I want to access to the about as apart because \nI want to know how the page was made,\nso I have confidence when using the site.\n‌\nScenario: Look for the information of the site\n    Given I am at GMO online site\n    When I click the \"About the GMO Site\" button\n    Then I see the list of technologies used for the site\n    \n        | HTML 3.2 |\n        | HTML Browser Extensions |\n        | Animation |\n        | JavaScript |\n        | CGI |\n        | Java |\n        | ActiveX |\n        | Client-side processes |\n        | Server-side processes |","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/BillingForm.feature","data":"Feature: As a online shopper\n  I want to know which field I should fix if I made a mistake in the billing form\n  So I can finish my purchase\n\nBackground:\n    Given I am at GMO online site\n    When I click the \"About the Enter GMO Online\" button\n\nScenario Outline: Fill the form with the correct data\n  And I write \"<value>\" in the value box \"<product>\"\n  When I click on the \"Place an order\" Button\n  And I see the summary of my purchase\n  When I click on the \"Proceed With Order\" Button\n  And I fill the form with the following data\n    | Name        | pepito            |\n    | Address     | perez    |\n    | City        | cochabamba        |\n    | State       | cochabamba                 |\n    | Zip         | 33126               |\n    | Phone       | 123-123-1234           |\n    | E-mail      | pepito@borland.com |\n    | Card Type   | American Express   |\n    | Card Number | 1234-123456-12345    |\n    | Expiration  | 11\/31              |\n  Then I click on the same as bill\n  When I click on the \"Place The order\" Button\n  Then I see the succesful notification\n  Examples:\n  | product                | value | \n  | 3 Person Dome Tent     | 1   |\n  | External Frame Backpack| 3     | \n\nScenario Outline: Fill the form with the wrong zip code 0000\n  And I write \"<value>\" in the value box \"<product>\"\n  When I click on the \"Place an order\" Button\n  And I see the summary of my purchase\n  When I click on the \"Proceed With Order\" Button\n  And I fill the form with the following data\n    | Name        | pepito            |\n    | Address     | perez    |\n    | City        | cochabamba        |\n    | State       | cochabamba                 |\n    | Zip         | 0000               |\n    | Phone       | 123-123-1234           |\n    | E-mail      | pepito@borland.com |\n    | Card Type   | American Express   |\n    | Card Number | 1234-123456-12345    |\n    | Expiration  | 11\/31              |\n  Then I click on the same as bill\n  When I click on the \"Place The order\" Button\n  Then A notification pops up \"Please enter a valid zip code in this field.\"\n  Examples:\n  | product                | value | \n  | 3 Person Dome Tent     | 1   |\n  | External Frame Backpack| 3     | \n\nScenario Outline: Fill the form with the wrong card number 1\n  And I write \"<value>\" in the value box \"<product>\"\n  When I click on the \"Place an order\" Button\n  And I see the summary of my purchase\n  When I click on the \"Proceed With Order\" Button\n  And I fill the form with the following data\n    | Name        | pepito            |\n    | Address     | perez    |\n    | City        | cochabamba        |\n    | State       | cochabamba                 |\n    | Zip         | 33126             |\n    | Phone       | 123-123-1234           |\n    | E-mail      | pepito@borland.com |\n    | Card Type   | American Express   |\n    | Card Number | 1    |\n    | Expiration  | 11\/31              |\n  Then I click on the same as bill\n  When I click on the \"Place The order\" Button\n  Then A notification pops up \"Please enter a valid card number of the form '1234-123456-12345' in this field.\"\n  Examples:\n  | product                | value | \n  | 3 Person Dome Tent     | 1  |\n  | External Frame Backpack| 3     | \n\nScenario Outline: Fill the form with the wrong phone number\n  And I write \"<value>\" in the value box \"<product>\"\n  When I click on the \"Place an order\" Button\n  And I see the summary of my purchase\n  When I click on the \"Proceed With Order\" Button\n  And I fill the form with the following data\n    | Name        | pepito            |\n    | Address     | perez    |\n    | City        | cochabamba        |\n    | State       | cochabamba                 |\n    | Zip         | 33126             |\n    | Phone       | 123-123-123          |\n    | E-mail      | pepito@borland.com |\n    | Card Type   | American Express   |\n    | Card Number | 1234-123456-12345   |\n    | Expiration  | 11\/31              |\n    \n  Then I click on the same as bill\n  When I click on the \"Place The order\" Button\n  Then A notification pops up \"Please enter a valid phone number in this field.\"\n  Examples:\n  | product                | value | \n  | 3 Person Dome Tent     | 1  |\n  | External Frame Backpack| 3     | \n\n\n  Scenario Outline: Fill the form with empty Name\n  And I write \"<value>\" in the value box \"<product>\"\n  When I click on the \"Place an order\" Button\n  And I see the summary of my purchase\n  When I click on the \"Proceed With Order\" Button\n  And I fill the form with the following data\n    | Name        |            |\n    | Address     | perez    |\n    | City        | cochabamba        |\n    | State       | cochabamba                 |\n    | Zip         | 33126             |\n    | Phone       | 123-123-123          |\n    | E-mail      | pepito@borland.com |\n    | Card Type   | American Express   |\n    | Card Number | 1234-123456-12345   |\n    | Expiration  | 11\/31              |\n    \n  Then I click on the same as bill\n  When I click on the \"Place The order\" Button\n  Then A notification pops up \"This is a required field.\"\n  Examples:\n  | product                | value | \n  | 3 Person Dome Tent     | 1  |\n  | External Frame Backpack| 3     | \n\n\n   Scenario Outline: Fill the form with empty Address\n  And I write \"<value>\" in the value box \"<product>\"\n  When I click on the \"Place an order\" Button\n  And I see the summary of my purchase\n  When I click on the \"Proceed With Order\" Button\n  And I fill the form with the following data\n    | Name        | pepito           |\n    | Address     |   |\n    | City        | cochabamba        |\n    | State       | cochabamba                 |\n    | Zip         | 33126             |\n    | Phone       | 123-123-123          |\n    | E-mail      | pepito@borland.com |\n    | Card Type   | American Express   |\n    | Card Number | 1234-123456-12345   |\n    | Expiration  | 11\/31              |\n    \n  Then I click on the same as bill\n  When I click on the \"Place The order\" Button\n  Then A notification pops up \"This is a required field.\"\n  Examples:\n  | product                | value | \n  | 3 Person Dome Tent     | 1  |\n  | External Frame Backpack| 3     | \n\n  Scenario Outline: Fill the form with empty city\n  And I write \"<value>\" in the value box \"<product>\"\n  When I click on the \"Place an order\" Button\n  And I see the summary of my purchase\n  When I click on the \"Proceed With Order\" Button\n  And I fill the form with the following data\n    | Name        | pepito           |\n    | Address     | perez  |\n    | City        |         |\n    | State       | cochabamba                 |\n    | Zip         | 33126             |\n    | Phone       | 123-123-123          |\n    | E-mail      | pepito@borland.com |\n    | Card Type   | American Express   |\n    | Card Number | 1234-123456-12345   |\n    | Expiration  | 11\/31              |\n    \n  Then I click on the same as bill\n  When I click on the \"Place The order\" Button\n  Then A notification pops up \"This is a required field.\"\n  Examples:\n  | product                | value | \n  | 3 Person Dome Tent     | 1  |\n  | External Frame Backpack| 3     | \n\n   Scenario Outline: Fill the form with empty state\n  And I write \"<value>\" in the value box \"<product>\"\n  When I click on the \"Place an order\" Button\n  And I see the summary of my purchase\n  When I click on the \"Proceed With Order\" Button\n  And I fill the form with the following data\n    | Name        | pepito           |\n    | Address     | perez  |\n    | City        | cochabamba        |\n    | State       |                 |\n    | Zip         | 33126             |\n    | Phone       | 123-123-123          |\n    | E-mail      | pepito@borland.com |\n    | Card Type   | American Express   |\n    | Card Number | 1234-123456-12345   |\n    | Expiration  | 11\/31              |\n    \n  Then I click on the same as bill\n  When I click on the \"Place The order\" Button\n  Then A notification pops up \"This is a required field.\"\n  Examples:\n  | product                | value | \n  | 3 Person Dome Tent     | 1  |\n  | External Frame Backpack| 3     | ","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/BrowserTestPage.feature","data":"Feature: Compare browser differences on GMO site\n  As a Online User \n  I want to compare browser differences, \n  So I should be able to view a list of features supported by different browsers.\n\n  Scenario: View list of differences between browsers\n    Given I am at GMO Browser Page\n    When I click the \"Browser Test Page\" button\n    Then I see the list of differences\n      | Internet Explorer 3.0      |\n      | Netscape Navigator 3.0     |\n      | Blinking Text              |\n      | dot bullets                |\n      | circle bullets             |\n      | square bullets             |\n      | Colored Horizontal Rules   |\n      | Definition Text Style      |\n      | (should be an italic font) |\n      | Trademarks are important™  |\n      | Table Properties           |\n\n","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/CalculateTotal.feature","data":"Feature: As an online shopper \n  I want the system to calculate the total of products cost\n  so I can see the final ammout\n\nBackground:\n    Given I am at GMO online site\n    When I click the \"About the Enter GMO Online\" button\n\nScenario: Fill the quantity of two different products\n\tAnd I write the quantities for the product in the table\n\n    | product                | input |   \n    | 3 Person Dome Tent     | 20     | \n    | External Frame Backpack| 20    |  \n\n    When I click on the \"Place an order\" Button\n    Then I see the Product Total as \"9598.80\"\n    And I see the correct Sales Tax as \"479.94\"\n    And I see the Grand Total as \"10083.74\"\n\n\nScenario: Fill the quantity of six different products\n\tAnd I write the quantities for the product in the table\n\n    | product                | input |   \n    | 3 Person Dome Tent     | 20    | \n    | External Frame Backpack| 21     |  \n    | Glacier Sun Glasses    | 22     | \n    | Padded Socks           | 23    | \n    | Hiking Boots           | 24    |  \n    | Back Country Shorts    | 25    |\n\n    When I click on the \"Place an order\" Button\n    Then I see the Product Total as \"14995.65\"\n    And I see the correct Sales Tax as \"749.78\"\n    And I see the Grand Total as \"15750.43\"\n\n\nScenario: Fill the quantity of six different products with high values\n\tAnd I write the quantities for the product in the table\n\n    | product                | input |   \n    | 3 Person Dome Tent     | 1000000    | \n    | External Frame Backpack| 1000000    |  \n    | Glacier Sun Glasses    | 1000000    | \n    | Padded Socks           | 1000000    | \n    | Hiking Boots           | 1000000    |  \n    | Back Country Shorts    | 1000000    |\n\n    When I click on the \"Place an order\" Button\n    Then I see the Product Total as \"702770000.00\"\n    And I see the correct Sales Tax as \"35138500.00\"\n    And I see the Grand Total as \"737908505.00\"\n\nScenario: Fill the quantity of six different products with high values\n\tAnd I write the quantities for the product in the table\n\n    | product                | input |   \n    | 3 Person Dome Tent     | 1000000    | \n    | Back Country Shorts    | 1000000    |\n\n    When I click on the \"Place an order\" Button\n    Then I see the Product Total as \"324940000.00\"\n    And I see the correct Sales Tax as \"16247000.00\"\n    And I see the Grand Total as \"341187005.00\"\n\nScenario: Fill the quantity of six different products with high values\n\tAnd I write the quantities for the product in the table\n\n    | product                | input |   \n    | 3 Person Dome Tent     | 1000000    | \n    | Hiking Boots           | 1000000    |  \n  \n    When I click on the \"Place an order\" Button\n    Then I see the Product Total as \"409890000.00\"\n    And I see the correct Sales Tax as \"20494500.00\"\n    And I see the Grand Total as \"430384505.00\"\n\nScenario: Fill the quantity of six different products with high values\n\tAnd I write the quantities for the product in the table\n\n    | product                | input |   \n    | 3 Person Dome Tent     | 1000000    | \n    | Padded Socks           | 1000000    | \n\n    When I click on the \"Place an order\" Button\n    Then I see the Product Total as \"319980000.00\"\n    And I see the correct Sales Tax as \"15999000.00\"\n    And I see the Grand Total as \"335979005.00\"\n\nScenario: Fill the quantity of six different products with high values\n\tAnd I write the quantities for the product in the table\n\n    | product                | input |   \n    | 3 Person Dome Tent     | 1000000    | \n    | Glacier Sun Glasses    | 1000000    | \n\n    When I click on the \"Place an order\" Button\n    Then I see the Product Total as \"367980000.00\"\n    And I see the correct Sales Tax as \"18399000.00\"\n    And I see the Grand Total as \"386379005.00\"","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/CalculateTotalProduct.feature","data":"Feature: As an online shopper \n  I want the system to calculate totals, taxes and shipping costs\n  so I can see the final ammout I need to pay\n\nBackground:\n    Given I am at GMO online site\n    When I click the \"About the Enter GMO Online\" button\n\nScenario Outline: Fill the quantity of just one product\n  And I write \"<value>\" in the value box \"<product>\"\n  When I click on the \"Place an order\" Button\n  Then I see the total price for each product\n  Examples:\n    | product                | value |   \n    | 3 Person Dome Tent     | 1     | \n    | External Frame Backpack| 1     |  \n    | Glacier Sun Glasses    | 1     | \n    | Padded Socks           | 1     | \n    | Hiking Boots           | 1     |  \n    | Back Country Shorts    | 1     |\n\nScenario Outline: Fill the quantity of just one product with different values\n  And I write \"<value>\" in the value box \"<product>\"\n  When I click on the \"Place an order\" Button\n  Then I see the total price for each product\n  Examples:\n    | product                | value |   \n    | 3 Person Dome Tent     | 2     | \n    | External Frame Backpack| 3     |  \n    | Glacier Sun Glasses    | 4     | \n    | Padded Socks           | 1000000000     | \n    | Hiking Boots           | 30    |  \n    | Back Country Shorts    | 20    |\n\n\nScenario Outline: Fill the quantity of just with different characters\n  And I write \"<value>\" in the value box \"<product>\"\n  When I click on the \"Place an order\" Button\n  Then A notification pops up \"Please enter only digits in this field.\"\n  Examples:\n    | product                | value |   \n    | 3 Person Dome Tent     | p     | \n    | External Frame Backpack| different     |  \n    | Glacier Sun Glasses    | a     | \n    | Padded Socks           | w     | \n    | Hiking Boots           | 30q    |  \n    | Back Country Shorts    | 20 qe   |\n","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/EnterGMOOnline.feature","data":"Feature: GMO Online Site Catalog\nAs an Online User \nI want to see the GMO Catalog, \nSo I should be able to view the catalog of the page.\n\nScenario: Verify Online Catalog items\n    Given I am at GMO online catalog\n    When I click the \"About the Enter GMO Online\" button\n    Then I see the Online Catalog\n        | Item Number | Item Name               | Unit Price | Order Quantity |\n        | 1000        | 3 Person Dome Tent      | $299.99    | 0              |\n        | 1001        | External Frame Backpack | $179.95    | 0              |\n        | 1002        | Glacier Sun Glasses     | $67.99     | 0              |\n        | 1003        | Padded Socks            | $19.99     | 0              |\n        | 1004        | Hiking Boots            | $109.90    | 0              |\n        | 1005        | Back Country Shorts     | $24.95     | 0              |","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/ProductInfo.feature","data":"Feature: View product details on the store\n  As a customer\n  I want to view the details of a product\n  So that I can decide whether I want to purchase it\nBackground:\n    Given I am at GMO online site\n    When I click the \"About the Enter GMO Online\" button\nScenario Outline: Look for a product and item number in the borland store        \n    And I click on the product \"<product>\"\n    Then I should see the item id \"<item>\"\n    Examples: \n      | product                | item |\n      | 3 Person Dome Tent     | 1000 |\n      | External Frame Backpack| 1001 |\n      | Glacier Sun Glasses    | 1002 |\n      | Padded Socks           | 1003 |\n      | Hiking Boots           | 1004 |\n      | Back Country Shorts    | 1005 |","mediaType":"text\/x.cucumber.gherkin+plain"}},
